import { useEffect, useState } from "react";


const ShowBook = () => {
    const [book, setBook] = useState([])
    const [loading, setLoading] = useState(true)

    const getBook = () => {
        axios.get('http://openlibrary.org/search.json?title=the+lost+world')
            .then(response => {
                console.log(response);
                setBook(response.data)
            })
            .catch(error => {
                console.log(error);
            });
    }
    
    useEffect(()=>{
        getBook()
    }, [])

    return (
        <div>
            {}
            {book.title}
        </div>
    );
}

export default ShowBook;
